theme.source:
@theme-name: t-button-default;

.@{theme-name} {
    .w-button-container {
        height: 36px;
        padding: 0 4px;
        background:transparent url(icon.png) no-repeat left top;
        .w-button-text {
            font-size: 14px;
            color: #4D4D4D;
            padding: 0 10px;
            text-align: center;
            background:transparent url(icon.png) repeat-x left bottom;
        }
        .w-button-right {
            width: 4px;
            background:transparent url(icon.png) no-repeat left center;
        }
    }
}

